import 'dart:convert';
/// status : null
/// isError : false
/// message : "success"
/// errors : []
/// payload : ""

GetWorkerImageResponse getWorkerImageResponseFromJson(String str) => GetWorkerImageResponse.fromJson(json.decode(str));
String getWorkerImageResponseToJson(GetWorkerImageResponse data) => json.encode(data.toJson());
class GetWorkerImageResponse {
  GetWorkerImageResponse({
      this.status, 
      this.isError, 
      this.message, 
      this.errors, 
      this.payload,});

  GetWorkerImageResponse.fromJson(dynamic json) {
    status = json['status'];
    isError = json['isError'];
    message = json['message'];
    if (json['errors'] != null) {
      errors = [];
      json['errors'].forEach((v) {
        errors?.add((v));
      });
    }
    payload = json['payload'];
  }
  dynamic status;
  bool? isError;
  String? message;
  List<dynamic>? errors;
  String? payload;
GetWorkerImageResponse copyWith({  dynamic status,
  bool? isError,
  String? message,
  List<dynamic>? errors,
  String? payload,
}) => GetWorkerImageResponse(  status: status ?? this.status,
  isError: isError ?? this.isError,
  message: message ?? this.message,
  errors: errors ?? this.errors,
  payload: payload ?? this.payload,
);
  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['status'] = status;
    map['isError'] = isError;
    map['message'] = message;
    if (errors != null) {
      map['errors'] = errors?.map((v) => v.toJson()).toList();
    }
    map['payload'] = payload;
    return map;
  }

}